        Precomputed style function\n- Skip arguments to array + join if there''s only
        one argument (the\n  common case)\n- Merge multiple return statements to one\n\nTo
        calculate the performance benefit:\n\n``` javascript\nvar chalk = require(''./index.js'');\nconsole.time(''100000
        iterations'');\nfor (var i = 0; i < 100000; i++) {\n    chalk.red(''A string
        that is about 80 characters long (normal use I think?)'');\n}\nconsole.timeEnd(''100000
        iterations'');\n```\n\nRunning this before this commit:\n\n``` shell\nfor
        i in {1..5}; do node time.js; done\n100000 iterations: 19485ms\n100000 iterations:
        18933ms\n100000 iterations: 19365ms\n100000 iterations: 19332ms\n100000 iterations:
        18660ms\n```\n\nAfter:\n\n``` shell\n100000 iterations: 268ms\n100000 iterations:
